" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Pseudomembranous colitis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 367px; height: 183px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Endsocopy of pseudomembranous colitis reveals small groups of pseudomembranes (left panel) that may be confused grossly with the aphthous ulcers of Crohn's disease (right panel). These lesions can be distinguished since pseudomembranes are present on top of the mucosa and do not result in ulceration of the underlying tissue.",
"    <div class=\"footnotes\">",
"    </div>",
