var title_f43_24_44423="Taeniasis life cycle";
var content_f43_24_44423=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F64879&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F64879&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 611px\">",
"   <div class=\"ttl\">",
"    Taeniasis life cycle",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 591px; height: 476px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Taeniasis is the infection of humans with the adult tapeworm of",
"    <em>",
"     Taenia saginata",
"    </em>",
"    ,",
"    <em>",
"     T. solium",
"    </em>",
"    , or",
"    <em>",
"     T. asiatica",
"    </em>",
"    . Humans are the only definitive hosts for these three species. Eggs or gravid proglottids are passed with feces",
"    <strong>",
"     (1)",
"    </strong>",
"    ; the eggs can survive for days to months in the environment. Cattle (",
"    <em>",
"     T. saginata",
"    </em>",
"    ) and pigs (",
"    <em>",
"     T. solium",
"    </em>",
"    and",
"    <em>",
"     T. asiatica",
"    </em>",
"    ) become infected by ingesting vegetation contaminated with eggs or gravid proglottids",
"    <strong>",
"     (2)",
"    </strong>",
"    . In the animal's intestine, the oncospheres hatch",
"    <strong>",
"     (3)",
"    </strong>",
"    , invade the intestinal wall, and migrate to the striated muscles, where they develop into cysticerci. A cysticercus can survive for several years in the animal. Humans become infected by ingesting raw or undercooked infected meat",
"    <strong>",
"     (4)",
"    </strong>",
"    . In the human intestine, the cysticercus develops over two months into an adult tapeworm, which can survive for years. The adult tapeworms attach to the small intestine by their scolex",
"    <strong>",
"     (5)",
"    </strong>",
"    and reside in the small intestine",
"    <strong>",
"     (6)",
"    </strong>",
"    . Length of adult worms is usually 5 m or less for",
"    <em>",
"     T. saginata",
"    </em>",
"    (however it may reach up to 25 m) and 2 to 7 m for",
"    <em>",
"     T. solium",
"    </em>",
"    . The adults produce proglottids which mature, become gravid, detach from the tapeworm, and migrate to the anus or are passed in the stool (approximately six per day).",
"    <em>",
"     T. saginata",
"    </em>",
"    adults usually have 1000 to 2000 proglottids, while",
"    <em>",
"     T. solium",
"    </em>",
"    adults have an average of 1000 proglottids. The eggs contained in the gravid proglottids are released after the proglottids are passed with the feces.",
"    <em>",
"     T. saginata",
"    </em>",
"    may produce up to 100,000 and",
"    <em>",
"     T. solium",
"    </em>",
"    may produce 50,000 eggs per proglottid respectively.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Centers for Disease Control and Prevention. Parasites and Health: Taeniasis. Available at:",
"     <a href=\"file://dpd.cdc.gov/dpdx/html/Taeniasis.htm\" target=\"_blank\">",
"      file://dpd.cdc.gov/dpdx/html/Taeniasis.htm",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
