var title_f43_24_44426="Left bundle branch block 1";
var content_f43_24_44426=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F52836%7ECARD%2F61594&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F52836%7ECARD%2F61594&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 531px\">",
"   <div class=\"ttl\">",
"    Complete left bundle branch block",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 511px; height: 139px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Delayed and abnormal activation of the left ventricular myocardium, and a diffuse slowing of conduction throughout the left ventricle leads to the following changes on the ECG: there is a tall monophasic and broadened R wave in leads I, aVL, and V6 instead of a septal Q wave; there is a QS complex which is abnormal and widened in V1 instead of a small initial R wave due to septal activation; the QRS interval is prolonged &gt;0.12 seconds; myocardial repolarization changes including T wave inversion and ST segment depression are evident.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1196px;\">",
"  <div class=\"figure\" style=\"width: 482px\">",
"   <div class=\"ttl\">",
"    Typical left bundle branch block",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 462px; height: 309px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electrocardiogram in typical complete LBBB. The asynchronous activation of the two ventricles increases the QRS duration (0.16 second in this example). The abnormal initial vector results in loss of \"normal\" septal forces as manifested by absence of q waves in leads I, aVL, and V6. The late activation of the left ventricle prolongs the dominant leftward progression of the middle and terminal forces, leading to a positive and widened R wave in the lateral leads. Both the ST segment and T wave vectors are opposite in direction from the QRS, a \"secondary\" repolarization abnormality.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Ary Goldberger, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 594px\">",
"   <div class=\"ttl\">",
"    Normal ECG",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 594px; height: 337px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal electrocardiogram showing normal sinus rhythm at a rate of 75 beats/min, a PR interval of 0.14 sec, a QRS interval of 0.10 sec, and a QRS axis of approximately 75&deg;.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Ary Goldberger, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
